package com.newgen.ao.laps.cache;

public class EADecisionMaster {
	String decisionTableName;
	String decisionColumnName;
	String responseTableName;
	String responseColumnName;
	public String getDecisionTableName() {
		return decisionTableName;
	}
	public void setDecisionTableName(String decisionTableName) {
		this.decisionTableName = decisionTableName;
	}
	public String getDecisionColumnName() {
		return decisionColumnName;
	}
	public void setDecisionColumnName(String decisionColumnName) {
		this.decisionColumnName = decisionColumnName;
	}
	public String getResponseTableName() {
		return responseTableName;
	}
	public void setResponseTableName(String responseTableName) {
		this.responseTableName = responseTableName;
	}
	public String getResponseColumnName() {
		return responseColumnName;
	}
	public void setResponseColumnName(String responseColumnName) {
		this.responseColumnName = responseColumnName;
	}
	

}
